import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState } from "react";
import Topbar from "./pages/Admin/Topbar";
import Sidebar from "./pages/Admin/Sidebar";
import AdminDashboard from "./pages/Admin/AdminDashboard";
import AdminHospital from "./pages/Admin/hospital";
import AdminPatient from "./pages/Admin/patient";
import Login from './pages/Login';
import DoctorLogin from './pages/DoctorLogin';
import PatienLogin from './pages/PatientLogin';
import Signup from './pages/Signup';
import AdminLogin from './pages/Admin/AdminLogin';
import { CssBaseline, ThemeProvider } from "@mui/material";
import { ColorModeContext, useMode } from "./theme";

function App() {
  const [theme, colorMode] = useMode();
  const [isSidebar, setIsSidebar] = useState(true);

  return (
    <ColorModeContext.Provider value={colorMode}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <div className="app">
          <Router>
            <Routes>
              <Route path="/" element={<Login />} />
              <Route path="/doctorlogin" element={<DoctorLogin />} />
              <Route path="/patientlogin" element={<PatienLogin />} />
              <Route path="/signup" element={<Signup />} />
              <Route path="/adminlogin" element={<AdminLogin />} />

              {/* Wrap Sidebar inside a Route or React.Fragment */}
              <Route>
                <Sidebar isSidebar={isSidebar} />
                <main className="content">
                  <Topbar setIsSidebar={setIsSidebar} />
                  <Routes>
                    <Route path="/admindashboard" element={<AdminDashboard />} />
                    <Route path="/adminhospital" element={<AdminHospital />} />
                    <Route path="/adminpatient" element={<AdminPatient />} />
                  </Routes>
                </main>
              </Route>
            </Routes>
          </Router>
        </div>
      </ThemeProvider>
    </ColorModeContext.Provider>
  );
}


export default App;
